//   const handleLogout = () => {
//     localStorage.removeItem('currentUser');
//     navigate('/login');
//   };

  return (
    <div className="dashboard-container">
      <header className="dashboard-header">
        <nav>
          <ul>
            <li>وام‌ها</li>
            <li>گزارش‌ها</li>
            <li>درباره ما</li>
            <li>ارتباط با ما</li>
          </ul>
        </nav>
        <div className="logo">مفـسـر</div>
      </header>

      <div className="dashboard-content">
        <aside className="sidebar">
          <div className="profile-section">
            <div className="avatar-icon">👤</div>
            <div className="user-info">
              <strong>علی احمدی</strong>
              <span>09123610250</span>
              <span>aliyara.a.84@gmail.com</span>
              <button className="edit-button">✏️</button>
            </div>
          </div>

          <ul className="menu">
            <li><FaWallet /> کیف پول</li>
            <li><FaFileAlt /> تراکنش‌ها</li>
            <li><FaBell /> پیام‌ها</li>
            <li><FaEnvelope /> تیکت‌ها</li>
          </ul>

          <button className="logout-button" >
            <FaSignOutAlt /> خروج
          </button>
        </aside>

        <main className="main-panel">
          <div className="info-box">لطفاً برای دادن وام از این طریق اطلاعات خود را تکمیل نمایید. <button>تکمیل اطلاعات</button></div>

          <div className="loan-card">
            <div className="loan-header">
              <h3>اطعام نیازمندان</h3>
              <span>سررسید: ۱۴۰۲/۰۵/۲۳</span>
              <span>تعداد سهم: ۲</span>
            </div>
            <div className="loan-footer">
              <span>مبلغ: ۱٬۰۰۰٬۰۰۰ تومان</span>
              <button className="details-button">+ جزئیات</button>
            </div>
          </div>

          <div className="loan-card">
            <div className="loan-header">
              <h3>اطعام نیازمندان</h3>
              <span>سررسید: ۱۴۰۲/۰۵/۲۳</span>
              <span>تعداد سهم: ۳</span>
            </div>
            <div className="loan-footer">
              <span>مبلغ: ۱٬۵۰۰٬۰۰۰ تومان</span>
              <button className="details-button">+ جزئیات</button>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

export default Dashboard;
